import React, { Component } from "react";
import FoodItem from './foodItems';

const items = [
  {
    name: "Chicken Momo"
  },
  {
    name: "Veg Momo"
  }
];

class FoodItems extends Component {

  render() {
    return (
      <div>
        <h2>Our Menu</h2>
        {
          items.map(foodItem => (
            <FoodItem name={foodItem.name}></FoodItem>
          ))
        }

      </div>
    );
  }
}

export default FoodItems;
